$('.column1').append('<h3>In conn4.php:</h3><pre class="prettyprint linenums lang-php"><?php<br /><br />/*****INCLUDES***********/<br />	include(\'conn4.functions.php\');<br /><br />/*****RETRIEVE POST INFORMATION***********/	<br /><br />	$playerColor = $_POST[\'color\'];<br />	$difficulty = $_POST[\'difficulty\']<br />	$redCells = $_POST[\'red\'];<br />	$blackCells = $_POST[\'black\'];<br />		$newmove = $_POST[\'newmove\'];<br />		$newmoveidsplit = explode($newmove,\'r\');<br />		$newmoverow = intval($newmoveidsplit[1]);<br />		$newmoveidsplit2 = explode($newmoveidsplit[0],\'c\');<br />		$newmovecolumn = intval($newmoveidsplit2[1]);<br />	$playermove = [\'column\'=>$newmovecolumn,\'row\'=>$newmoverow];<br />	<br />/*****CREATE EMPTY HIGHESTs, BEST MOVEs***********/	<br />	$highestRow = [];<br />	$highestRow[\'medium\'] = [\'column1\' => 0,\'column2\' => 0,\'column3\' => 0,\'column4\' => 0,\'column5\' => 0,\'column6\' => 0,\'column7\' => 0];<br />		$highestRow[\'hard\'] = [<br />			\'column1\' => $highestRow[\'medium\'],<br />			\'column2\' => $highestRow[\'medium\'],<br />			\'column3\' => $highestRow[\'medium\'],<br />			\'column4\' => $highestRow[\'medium\'],<br />			\'column5\' => $highestRow[\'medium\'],<br />			\'column6\' => $highestRow[\'medium\'],<br />			\'column7\' => $highestRow[\'medium\']<br />			];<br /><br />	<br />	$bestmove= [<br />		\'medium\' => [],<br />		\'hard\' => []<br />		];<br />	<br />/*****SET PLAYBOARD AND HIGHEST:1st Move***********/<br />	<br />	$redCellsArray = [];<br />	$blackCellsArray = [];<br />	foreach ($redCells as $reds){<br />		$idsplit = explode($reds,\'r\');<br />		$row = intval($idsplit[1]);<br />		$idsplit2 = explode($idsplit[0],\'c\');<br />		$column = intval($idsplit2[1]);<br />		<br />		push($redCellArray, [<br />			\'column\' => $column,<br />			\'row\' => $row<br />			]);<br />		if ($highestRow[$column] < $row){<br />			$highestRow[$column] = $row;<br />		}<br />	}<br />	foreach ($blackCells as $blacks){<br />		$idsplit = explode($blacks,\'r\');<br />		$row = intval($idsplit[1]);<br />		$idsplit2 = explode($idsplit[0],\'c\');<br />		$column = intval($idsplit2[1]);<br />		<br />		push($blackCellArray, [<br />			\'column\' => $column,<br />			\'row\' => $row<br />			]);<br />		if ($highestRow[$column] < $row){<br />			$highestRow[$column] = $row;<br />		}<br />	}<br />	if ($playercolor == \'red\'){<br />		$playerCellArray = $redCellArray;<br />		$compCellArray = $blackCellArray;<br />	}<br />	else{<br />		$playerCellArray = $blackCellArray;<br />		$compCellArray = $redCellArray;<br />	}<br /><br />/*****Check for Win**********/<br />	$playerwin = checkwin($playermove,$playerCellArray);<br />	/*check player\'s possible wins and verify*/<br />	if ($playerwin == 1){<br />		$move = \'0\';<br />		exit($move);<br />	}<br /><br />/*****MAKE RANDOM MOVE - EASY***********/<br />	if ($difficulty == \'easy\'){<br />		$compColumn = rand(1, 7);<br />		$compRow = $highestRow[\'medium\'][$compColumn]+1;<br />		$compmove = [\'column\' => $compColumn,\'row\'=>$compRow];<br />		push($compCellArray, $compmove);<br />		$compwin = checkwin($compmove,$compCellArray);<br />		if ($compwin == 1){<br />			$move = \'00\';<br />		}<br />		else{<br />			$move = $compmove[\'column\'];<br />		}<br />		<br />		exit($move);<br />	}<br /><br />/*****CALCULATE BEST MOVE: scope=1 - MEDIUM***********/<br /><br />	if ($difficulty == \'medium\'){<br />		/*pull random from bestmove[\'1\']*/<br />		<br />		push($compCellArray, $compmove);<br />		$compwin = checkwin($compmove,$compCellArray);<br />		if ($compwin == 1){<br />			$move = \'00\';<br />		}<br />		else{<br />			$move = $compmove[\'column\'];<br />		}<br />		<br />		exit($move);<br />	}<br /><br />/*****CALCULATE BEST MOVE: scope=2* - HARD**********/<br /><br /><br />	if ($difficulty == \'hard\'){<br />		/*pull random from bestmove[\'2\']*/<br />		<br />		<br />		push($compCellArray, $compmove);<br />		$compwin = checkwin($compmove,$compCellArray);<br />		if ($compwin == 1){<br />			$move = \'00\';<br />		}<br />		else{<br />			$move = $compmove[\'column\'];<br />		}<br />		<br />		exit($move);<br />	}<br /><br />?></pre>');

